import React from 'react';
import {Button} from '@chakra-ui/core';

export function LandingPage(props) {
    const login = () => window.location.href = 'http://localhost:3001/api/auth/discord'; //redirect to express auth route
    return (
        <Button
        onClick={login} 
        variantColor="orange">
        Login
        </Button>
    )
}
